import React, { Component } from 'react';


class ProjectItem extends Component {
  render() {
    console.log(this.props);
    return (
      <li className="Project">
      <strong>  {this.props.project.title} </strong> : {this.props.project.title}
      </li>
    );
  }
}

export default ProjectItem;
